import React from 'react';
import styled from 'styled-components';
import { Pagination, FreeMode } from 'swiper';
import { Swiper, SwiperSlide } from 'swiper/react';
import COLORS from '../../styles/colors'
import { FONT_STYLES } from '../../styles/font-style';

import IcLocation from '../../assets/ic-location.png';
import IcAlarm from '../../assets/ic-alarm.png';
import IcSettings from '../../assets/ic-settings.png';
import IcDivision from '../../assets/ic-division.png';
import MainSample from '../../assets/img-main-sample.png';
import DummyCard from '../../assets/img-dummy-card.png';

import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

const images = [DummyCard, DummyCard, DummyCard, DummyCard, DummyCard, DummyCard];

  const Styled = {
    Wrap: styled.div`
    `,
    System: styled.div`
      width: 100%;
      height: 44px;
      background-color: ${COLORS.Gray100};
    `,
    Header: styled.div`
      height: 52px;
      background-color: ${COLORS.Gray200};
      display: flex;
      justify-content: space-between;
      align-items: center;
    `,
    LocationTxt: styled.div`
      ${FONT_STYLES.R_12}
    `,
    LeftWrap: styled.div`
      display: flex;
    `,
    RightIconWrap: styled.div`
      display: flex;
    `,
  }

  const Icon = {
    Location: styled.img`
      width: 16px;
      height: 16px;
      margin: 0px 20px;
    `,
    Alarm: styled.img`
      width: 16px;
      height: 16px;
      margin-right: 11px;
    `,
    Settings: styled.img`
      width: 16px;
      height: 16px;
      margin-right: 20px;
    `,
  };

  const Banner = {
    MainImg: styled.div`
      width: 100%;
      height: 100%;
      background-image: url(${MainSample});
      background-repeat: no-repeat;
      background-size: cover;
      margin-bottom: 25px;
    `,
    TextWrap: styled.div`
      display: flex;
      flex-direction: column;
      justify-content: flex-end;
      margin-bottom: 20px;
    `,
    WhiteArea: styled.div`
      width: 335px;
      height: 63px;
      background-color: ${COLORS.White};
      border-radius: 100px;
      text-align: center;
    `,
    BannerWrap: styled.div`
      display: flex;
      height: 375px;
      justify-content: center;
    `,

    MainText: styled.div`
      color: ${COLORS.White};
      display: flex;
      align-items: center;
      justify-content: center;
      text-align: center;
      ${FONT_STYLES.B_14}
    `,
    SubTextWrap: styled.div`
      display: flex;
      background-color: blue;
    `,
    SubText: styled.div`
      display: flex;
      justify-content: center;
      color: ${COLORS.White};
      ${FONT_STYLES.R_11}
    `,
    Division: styled.img`
      width: 1px;
      height: 31px;
    `,
  };

  const Component = {
    Margin: styled.div`
      margin: 0px 20px;
    `,
  };

  const Category = {
    TitleTxt: styled.div`
      ${FONT_STYLES.B_16}
    `,
    MoreTxt: styled.div`
      ${FONT_STYLES.R_11}
    `,
    Header: styled.div`
      display: flex;
      justify-content: space-between;
      margin-bottom: 12px;
    `,
  }

  const ImgSwiper = {
    Wrap: styled.div`
      height: 156px;
    `,
    Card: styled.img`
      // width: 108px;
      height: 144px;
    `,
  }


function Home() {
  return (
    <div>
      <Styled.System />
      <Styled.Header>
        <Styled.LeftWrap>
          <Icon.Location src={IcLocation} />
          <Styled.LocationTxt>Dongjak-gu, Sangdo-dong</Styled.LocationTxt>
        </Styled.LeftWrap>

        <Styled.RightIconWrap>
          <Icon.Alarm src={IcAlarm} />
          <Icon.Settings src={IcSettings} />
        </Styled.RightIconWrap>
      </Styled.Header>

      <Banner.MainImg>
        <Banner.BannerWrap>
          <Banner.TextWrap>
            {/* <Banner.MainText>Now</Banner.MainText>
            <Banner.MainText>28°C</Banner.MainText> */}

            <Banner.SubTextWrap>
              <Banner.SubText>Humidity<br/>50%</Banner.SubText>
              <Banner.Division src={IcDivision}/>
              <Banner.SubText>Weather<br/>Cloudy</Banner.SubText>
            </Banner.SubTextWrap>
            <Banner.WhiteArea>~~~기상청API연동~~~</Banner.WhiteArea>
          </Banner.TextWrap>
        </Banner.BannerWrap>
      </Banner.MainImg>

      <Component.Margin>
        <Category.Header>
          <Category.TitleTxt>Top</Category.TitleTxt>
          <Category.MoreTxt>More</Category.MoreTxt>
        </Category.Header>

        <ImgSwiper.Wrap>
          <Swiper
          slidesPerView={3}
          spaceBetween={20}
          modules={[Pagination, FreeMode]}
          centeredSlides
          freeMode
          loop
          >
          {images.map((v) => (
              <SwiperSlide><ImgSwiper.Card src={v}/></SwiperSlide>
          ))}
        </Swiper>
      </ImgSwiper.Wrap>

      <Category.Header>
          <Category.TitleTxt>Outer</Category.TitleTxt>
          <Category.MoreTxt>More</Category.MoreTxt>
        </Category.Header>

        <ImgSwiper.Wrap>
          <Swiper
          slidesPerView={3}
          spaceBetween={20}
          modules={[Pagination, FreeMode]}
          centeredSlides
          freeMode
          loop
          >
          {images.map((v) => (
              <SwiperSlide><ImgSwiper.Card src={v}/></SwiperSlide>
          ))}
        </Swiper>
      </ImgSwiper.Wrap>
    </Component.Margin>
    </div>
  )
}

export default Home
